import React, { useEffect } from "react";
import ReactDOM from "react-dom";
import App from "./App";
import GlobalProvider from "./contexts/GlobalProvider";
import Favicon from 'react-favicon';

import "./i18n";

//Import Scss
import "./assets/scss/themes.scss";
import SquadCommunicator from "./services/SquadCommunicator";
import SquadSipCommunicator from "./services/SquadSipCommunicator";
import ModalDisconnected from "./components/ModalDisconnected";
import { useChat } from "./contexts/ChatContext";

const { unreadSum } = useChat();

ReactDOM.render(
  <GlobalProvider>
    {unreadSum !== 0 ? (<Favicon alertCount={unreadSum}
    url="./favicon.ico"/>) : (<Favicon
      url="./favicon.ico"/>) }
    <SquadSipCommunicator />
    <SquadCommunicator />
    <ModalDisconnected />
    <App />
  </GlobalProvider>,
  document.getElementById("root")
);
